import React,{Component} from 'react';
import Banner from './Banner';

const url="http://localhost:8900/artists"
class Home extends Component {
    constructor(){
        super()

        this.state={
            artists:''
        }
    }


    render(){
        return(
            <Banner/>
        )
    }

    componentDidMount(){
        fetch(url,{
            method:'GET'
        })

    }

}


export default Home;
